function Task(props){
    let {list = []} = props

    console.log('=====list====', list)
    return (
        <ul>
            {
                list.map(item => (
                    <li key={item.id}>
                        <span>{item.text}</span>
                        <span>{item.completed ? '（已完成）' : '（未完成）'}</span>
                        <span></span>
                    </li>
                ))
            }
        </ul>
    )
}

export default Task;
